import Button from 'react-bootstrap/Button';

function NewButton() {
    const shoot = (a) => {
        alert(a)
    }


  return (
    <>
      <Button onClick={() => shoot("Goal!")} variant="success">Shoot</Button>{' '}
    </>
  );
}

export default NewButton;
